  - unified viscoplastic model and its application to some uniaxial and multiaxial
  - 'problems, NASA-TM-89891, 1987."'
  - thick-walled cylinder subjected to internal pressure under isothermal conditions
  - '(constant temperature (T=699.81667K), alpha_T=0).'
